import { jsx as d } from "react/jsx-runtime";
const W = "data:image/png;base64,", Y = ({
  className: E,
  ...A
}) => /* @__PURE__ */ d(
  "img",
  {
    ...A,
    alt: "pdf",
    src: W
  }
);
export {
  Y as DarkPdfIcon
};
